class NFT {
    constructor(background, pants, upperbody, hands, face, faceElement, head, sunglasses){
        this.background = background
        this.pants = pants
        this.upperbody = upperbody
        this.hands = hands
        this.face = face
        this.faceElement = faceElement
        this.head = head
        this.sunglasses = sunglasses
        this.statisticalRarity = 0
    }

    setStatisticalRarity(){
        this.statisticalRarity  = (100 - (( this.background * this.pants  * this.upperbody * this.hands * this.face * this.faceElement * this.head * this.sunglasses) * 10000000000))
    }

    setAverageRarity(){
        this.averageRarity = (100 - (((this.background * this.pants  * this.upperbody * this.hands * this.face * this.faceElement * this.head * this.sunglasses) / 9) * 100))
    }
}

